export default definePlugin({
    name: "antiSnitch",
    description: "Tools to avoid snitches",
    authors: [{ name: "curve", id: 818846027511103508n }, { name: "dot", id: 1400606596521791773n }],
    settings,
    start() {
        FluxDispatcher.subscribe("VOICE_STATE_UPDATES", cb);
    },
    stop() {
        FluxDispatcher.unsubscribe("VOICE_STATE_UPDATES", cb);
    }
});


const cb = (e) => {
    const state = e.voiceStates[0];
    if (!state?.channelId) return;
    if (state.userId === UserStore.getCurrentUser().id || !state.userId) return;
    if (state?.channelId === state?.oldChannelId) return;

    const channelVoiceStates = VoiceStateStore.getVoiceStatesForChannel(state?.channelId) ?? {};
    if (!Object.keys(channelVoiceStates).includes(UserStore.getCurrentUser().id)) return;

    if (
        userIdList.includes(state.userId) ||
        (state.userId === UserStore.getCurrentUser().id &&
         userIdList.some(id => VoiceStateStore.getVoiceStatesForChannel(state.channelId)[id]))
    ) {
        Toasts.show({
            message: `SNITCH ALERT: User ${state.userId} detected`,
            id: "snitch-alert",
            type: Toasts.Type.FAILURE,
            options: {
                position: Toasts.Position.BOTTOM
            }
        });
        audio();
    }
};


function audio() {
    const audioElement = document.createElement("audio");
    audioElement.src = alarm;

    // Get the volume from settings (0-100 scaled to 0-1)
    const volume = settings.store.volume / 100;
    audioElement.volume = volume;

    audioElement.play().catch(e => console.error("Audio play failed:", e));
}